import React from "react";

import Accordion from "./components/Accordion";

const items = [
  {
    title: 'What is React?',
    content: 'React is a framework'
  },
  {
    title: 'What is Angular?',
    content: 'React is a framework'
  },
  {
    title: 'What is this?',
    content: 'It is a pencil'
  }
];

const App = () => {
  return( 
    <div>
      <br />
      <Accordion items={items} />
    </div>
  )
}

export default App;
